import React from 'react';
import { Map, Marker, TileLayer } from 'react-leaflet'

function handleClick(num) {
	return () => {
		console.log("You clicked item " + num);
	}
}

const LatLongMap = ({cx, cy, z, x, y}) => {
	var center = [cx, cy];
	var position = [x, y];
	return <Map center={center} zoom={z}>
    	<TileLayer
      		url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      		attribution="&copy; <a href=&quot;http://osm.org/copyright&quot;>OpenStreetMap</a> contributors"
    	/>
    	<Marker position={position}/>
	</Map>
}

const LatLongList = ({latLongs}) => {
	var num = -1;
	return <table>
		<tbody>
			{
				latLongs.map(latLong => {
					num = num + 1
					return <tr key={latLong.latitude + "," + latLong.longitude}>
						<td onClick={handleClick(num, latLong)}>{latLong.latitude + ", " + latLong.longitude}</td>
					</tr>
				}
					)
			}
		</tbody>
    </table>
}

const LatLongsComponent = ({latLongs}) => (
    <table>
		<tbody>
			<tr>
				<td><LatLongList latLongs={latLongs}/></td>
				<td><LatLongMap cx={0} cy={0} z={13} x={0} y={0}/></td>
			</tr>
		</tbody>
    </table>
  )


export default LatLongsComponent;
